import React from 'react';
import './ProjectCard.css';

function ProjectCard(props) {
  return (
    <div>
    {props.projects.map(item =>{
<div className="card">
      <h1>{props.title}</h1>
      <img src={props.imgURL} alt={props.title} />
      <p>hello world</p>
      <a className="btn btn-danger" src={props.deployed}>
        Deployed App
      </a>
      <a className="btn btn-success" src={props.github}>
        Github Repo
      </a>
    </div>

    })}
    </div>
  );
}

export default ProjectCard;
